import React, {useState, useEffect} from 'react'
import axios from "axios"

export default function App() {
    const [food, setFood] = useState([])

    useEffect(() => {
        axios.get('/food')
        .then(res => setFood(res.data))
        .catch(err => console.log(err))
    }, [])

    return (
        <div>
            {food.map}
            <h1>Hello React</h1>
        </div>
    )
}
